  margin: 25px auto;
  width: 40px;
  height: 40px;

  -webkit-transform: rotateZ(45deg);
  transform: rotateZ(45deg);
}

.folding-cube-spinner div {
  position: relative;
  float: left;
  width: 50%;
  height: 50%;
  background-color: transparent !important;
  -webkit-transform: scale(1.1);
  -ms-transform: scale(1.1);
  transform: scale(1.1);
